<?php		require_once("../model/RegisterFormModel.phpm");		session_start();		if( isset($_POST['logout']) ) {		session_destroy();		header("Location: ../view/login.php");	}	else if( isset($_POST['see_all_user']) ) {		if( isset($_SESSION['loginUserName']) ) {			$objRFM = new RegisterFormModel();			$_SESSION['user_table'] = $objRFM->getAllUser($_SESSION['loginUserName']);		}		header("Location: ../view/home.php");	}	?>